import React, { useState } from "react";
import { Route, Switch, Redirect } from "react-router-dom";

const App = () => {
  return (
    <>
      <h1>Hello world!</h1>
      <Switch>
      <Route exact path="/register" render={() => <p>Solo en register</p>}/>
      </Switch>
    </>
  );
};

export default App;
